import React from "react";
import Layout from "../components/Layout";
import axios from "axios";

import { Container, Row, Col } from "reactstrap";

class Navy extends React.Component {
  static async getInitialProps() {
    const { data } = await axios.get("http://localhost:3000/api/news");
    return { data };
  }

  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <Layout page="article">
        <Container>
          <Row>
            <Col sm="12">
                <div>

              <img src="/static/images/airbus320.png" className="navy-image" />
                </div>
            </Col>
            <Col sm="12">Y</Col>
          </Row>
        </Container>
      </Layout>
    );
  }
}

export default Navy;
